 ) and Reverb ( alpha ) (

 ) are two members of this family whose biological functions are largely unknown . In addition , no ligand has been yet identified for these two receptors ; therefore , they are referred as orphan receptors . Here , we show that ROR ( alpha ) and Reverb ( alpha ) are expressed with a similar tissue distribution and are both induced during the differentiation of rat Q9BTT4 myoblastic cells . Ectopic expression of ROR ( alpha ) 1 in Q9BTT4 cells significantly induces Reverb ( alpha ) expression as demonstrated by Northern blot analysis . Using reverse transcription-PCR to analyze Reverb ( alpha ) gene expression from staggerer mice , we found that there was a significant reduction of Reverb ( alpha ) mRNA in the skeletal muscle comparing it with the wild-type mice , which suggests that ROR ( alpha ) is involved in the regulation of Reverb ( alpha ) gene expression . Transient transfection assays using the Reverb ( alpha ) promoter demonstrate that ROR ( alpha ) regulates the Reverb ( alpha ) gene at the transcriptional level . Furthermore , mutagenesis experiments indicate that ROR ( alpha ) regulates Reverb ( alpha ) transcription via a monomeric ROR response element located in the Reverb ( alpha ) gene promoter . Electrophoretic mobility shift assays show that ROR ( alpha ) binds strongly to this site in a specific-manner . Finally , overexpression of

<div class="entities" style="line-height: 2.5; direction: ltr">Design , synthesis , and biological evaluation of 3,4- diarylmaleimides as angiogenesis inhibitors . The new analogue 2 of combretastatin A - 4 was discovered to be an inhibitor of tubulin polymerization with an IC50 of 7.6 microM and reduced angiogenesis in the in vivo chick embryo model . Interestingly , in a series of 2,3- diarylmaleimides closely related to this lead , no other compound was found to be active in the tubulin polymerization assay . However , by screening in the in vivo chick embryo assay 10 was identified as a potent angiogenesis inhibitor indicating an alternative target . Indeed , molecular modeling studies suggest a reasonable binding mode of 10 at the DB00171 - binding site of the model kinase 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 . Motivated by these results , analogues of 10 were screened for inhibitory activity in a panel of 12 selected protein kinases and a high affinity of 10 to 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 - R2 was found showing an IC50 of 2.5 nM . Structure-activity relationships ( SAR ) for this compound series with the isolated enzyme and equivalent antiangiogenic activity in the chick embryo assay are presented herein .</div>

<h2 style="margin: 0">7</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Coadministrating luteolin minimizes the side effects of the aromatase inhibitor letrozole . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 inhibitors ( AIs ) have been used as adjuvant therapeutic agents for breast cancer . Their adverse side effect on blood lipid is well documented . Some natural compounds have been shown to be potential AIs . In the present study , we compared the efficacy of the flavonoid luteolin to the clinically approved AI letrozole ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ; Novartis Pharmaceuticals , East Hanover , NJ ) in a cell and a mouse model . In the in vitro experimental results for aromatase inhibition , the Ki values of luteolin and letrozole were estimated to be 2.44 µM and 0.41 nM , respectively . Both letrozole and luteolin appeared to be competitive inhibitors . Subsequently , an animal model was used for the comparison . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 - expressing MCF - 7 cells were transplanted into ovariectomized athymic mice . Luteolin was given by mouth at 5 , 20 , and 50 mg / kg , whereas letrozole was administered by intravenous injection . Similar to letrozole , luteolin administration reduced plasma estrogen concentrations and suppressed the xenograft proliferation . The regulation of cell cycle and apoptotic proteins-such as a decrease in the expression of Bcl-xL , cyclin-A / D1 / E , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 / 4 , and increase in that of Bax-was about the same in both treatments . The most significant disparity was on blood lipids . In contrast to letrozole , luteolin increased fasting plasma high-density lipoprotein concentrations and produced a desirable blood lipid profile . These results suggested that the flavonoid could be a coadjuvant therapeutic agent without impairing the action of AIs .</div>

<h2 style="margin: 0">19</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">A synthetic dl-nordihydroguaiaretic acid ( Nordy ) , inhibits angiogenesis , invasion and proliferation of glioma stem cells within a zebrafish xenotransplantation model . The zebrafish ( Danio rerio ) and their transparent embryos represent a promising model system in cancer research . Compared with other vertebrate model systems , we had previously shown that the zebrafish model provides many advantages over mouse or chicken models to study tumor invasion , angiogenesis , and tumorigenesis . In this study , we systematically investigated the biological features of glioma stem cells ( GSCs ) in a zebrafish model , such as tumor angiogenesis , invasion , and proliferation . We demonstrated that several verified anti-angiogenic agents inhibited angiogenesis that was induced by xenografted-GSCs . We next evaluated the effects of a synthetic dl-nordihydroguaiaretic acid compound ( dl-NDGA or &quot; Nordy &quot; ) , which revealed anti-tumor activity against human GSCs in vitro by establishing parameters through studying its ability to suppress angiogenesis , tumor invasion , and proliferation . Furthermore , our results indicated that Nordy might inhibit GSCs invasion and proliferation through regulation of the arachidonate 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P09917
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( Alox - 5 ) pathway . Moreover , the combination of Nordy and a 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P15692
